const content = {
    inputs:[
        {
            label: "Full name",
            name: "fullname",
            type: "text",
        },
        {
            label: "email",
            name: "email",
            type: "email" 
        },
        {
            label: "password",
            name: "password",
            type: "password"
        }
    ]
}
export default content;
